import { useState } from 'react';
import Carousel from 'react-bootstrap/Carousel';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../styles/App.css';

function ControlledCarousel() {  // Make sure the component name is correct
  const [index, setIndex] = useState(0);

  const handleSelect = (selectedIndex) => {
    setIndex(selectedIndex);
  };

  return (
    <Carousel activeIndex={index} onSelect={handleSelect} interval={null} pause={null}>
      <Carousel.Item>
        <div className="d-block w-100 h-100">
          <h3>Blank Slide</h3>
        </div>
      </Carousel.Item>
      <Carousel.Item>
        <div className="d-block w-100 h-100">
          <h3>Blank Slide</h3>
        </div>
      </Carousel.Item>
      <Carousel.Item>
        <div className="d-block w-100 h-100">
          <h3>Blank Slide</h3>
        </div>
      </Carousel.Item>
    </Carousel>
  );
}

export default ControlledCarousel;  // Ensure it's exported properly
